--2. What range of week numbers are missing from the dataset?
-- WE can create CTE for the range of the week numbers where we call the CTE within itself using Recursion to get the week numbers that are missing

missing_weeknum AS(
SELECT 1 AS week_number
UNION ALL
SELECT week_number + 1
FROM missing_weeknum
WHERE week_number < 52
)

SELECT *
FROM missing_weeknum
WHERE week_number NOT IN(
  SELECT DISTINCT week_number
  FROM clean_weekly_sales
) option (maxrecursion 1000)
-- We don't have 28 weeks of data between weeks 1-12 and 13-28

