--6. What is the percentage of sales for Retail vs Shopify for each month?
SELECT perc.Calender_year, perc.Month_number, ROUND(100 * MAX(CASE WHEN platform = 'Shopify' Then perc.[monthly sales]
ELSE NULL END)/ SUM([monthly sales]), 2) AS [Shopify Percentage],

ROUND(100 * MAX(CASE WHEN platform = 'Retail' Then perc.[monthly sales]
ELSE NULL END)/ SUM([monthly sales]), 2) AS [Retail Percentage]

FROM
(
SELECT Calender_year, Month_number, platform, SUM(CAST(Sales AS float)) AS [monthly sales]
FROM clean_weekly_sales
GROUP BY Calender_year, Month_number, platform
)perc 
GROUP BY perc.Calender_year, perc.Month_number
ORDER BY perc.Month_number

--7. What is the percentage of sales by demographic for each year in the dataset?

SELECT perc.Calender_year, ROUND(100 * MAX(CASE WHEN Demographic = 'Couples' Then perc.[Yearly sales]
ELSE NULL END)/ SUM([Yearly sales]), 2) AS [Sales Percentage by Couples],

ROUND(100 * MAX(CASE WHEN Demographic = 'Families' Then perc.[Yearly sales]
ELSE NULL END)/ SUM([Yearly sales]), 2) AS [Sales Percentage by Families],

ROUND(100 * MAX(CASE WHEN Demographic = 'Unknown' Then perc.[Yearly sales]
ELSE NULL END)/ SUM([Yearly sales]), 2) AS [Sales Percentage by Unknown]

FROM
(
SELECT Calender_year, Demographic, SUM(CAST(Sales AS float)) AS [Yearly sales]
FROM clean_weekly_sales
GROUP BY Calender_year, Demographic
)perc
GROUP BY perc.Calender_year
ORDER BY perc.Calender_year

--8. Which age_band and demographic values contribute the most to Retail sales?

SELECT Age_band, Demographic, SUM(CAST(sales AS FLOAT)) AS [Sales in retail], 
ROUND(100 * SUM(CAST(sales AS float)),2)/ (SELECT SUM(CAST(sales AS FLOAT))  FROM clean_weekly_sales) AS [Contribution]
FROM clean_weekly_sales 
WHERE platform = 'Retail'
GROUP BY Age_band, Demographic
ORDER BY [Sales in retail]

--9. Can we use the avg_transaction column to find the average transaction size for each year for Retail vs Shopify? If not - how would you calculate it instead?
-- No we cannot use the avg_transaction column to find the average transaction size for each year because that is only calculating one sale per record divided by one transaction per record so 
--that won't bring the right result because it will divide the sales and transactions per record.

--To calculate the average transaction size for each year for retail vs shopify, we will need to find the total number of sales and divide that by the total number of transactions to get the right result.

SELECT Calender_year, platform, ROUND(SUM(CAST(sales AS FLOAT))/ SUM(transactions), 2) AS [Average transaction size]
FROM clean_weekly_sales 
GROUP BY Calender_year, platform
ORDER BY Calender_year

----C. Before and After Analysis
/*
This technique is usually used when we inspect an important event and want to inspect the impact before and after a certain point in time.

Taking the week_date value of 2020-06-15 as the baseline week where the Data Mart sustainable packaging changes came into effect.

We would include all week_date values for 2020-06-15 as the start of the period after the change and the previous week_date values would be before

Using this analysis approach - answer the following questions:

What is the total sales for the 4 weeks before and after 2020-06-15? What is the growth or reduction rate in actual values and percentage of sales?
What about the entire 12 weeks before and after?
How do the sale metrics for these 2 periods before and after compare with the previous years in 2018 and 2019?
*/

--1. What is the total sales for the 4 weeks before and after 2020-06-15? What is the growth or reduction rate in actual values and percentage of sales?
--We first need to get the week_number for the date 2020-06-15 so that we can come up with the ranges for the before 2020-06-15 and after 2020-06-15
/*
SELECT DISTINCT week_number 
FROM clean_weekly_sales 
WHERE week_date = '2020-06-15'
*/
--From this query we can see that the weekdate falls under week 25.

--So now we can create a CTE for the total sales filtered four weeks before week 25 and four weeks after week 25.
tsales4 AS(
SELECT week_date, week_number, SUM(CAST(sales as FLOAT)) AS [Total Sales]
FROM clean_weekly_sales 
WHERE (week_number BETWEEN 21 and 28) and Calender_year = '2020'
GROUP BY week_date, week_number
),

--Then we will create a CTE for both before and after week 25 sales

before_after_sales4 AS(
    SELECT 
    SUM(CASE WHEN week_number BETWEEN 21 and 24 THEN [Total Sales] END) AS [Before Sales],
    SUM(CASE WHEN week_number BETWEEN 25 and 28 THEN [Total Sales] END) AS [After Sales]
    FROM tsales4
)

SELECT [Before Sales], [After Sales], [After Sales] - [Before Sales] AS [Sales Time Diff], ROUND(100*([After Sales] - [Before Sales])/ [Before Sales],2) AS [Growth/Decline in Sales]
FROM before_after_sales4

--Decline of sales four weeks after week 25 were at a 0.3% decline.

--2. What about the entire 12 weeks before and after?

--We will do the same thing as part 1 except now we will go 12 weeks before week 25 and 12 weeks after week 25 instead of 4 weeks before/after
--So now we can create a CTE for the total sales filtered twelve weeks before week 25 and twelve weeks after week 25.
tsales12 AS(
SELECT week_date, week_number, SUM(CAST(sales as FLOAT)) AS [Total Sales]
FROM clean_weekly_sales 
WHERE (week_number BETWEEN 13 and 37)
GROUP BY week_date, week_number
),

--Then we will create a CTE for both before and after week 25 sales



before_after_sales12 AS(
    SELECT 
    SUM(CASE WHEN week_number BETWEEN 13 and 24 THEN [Total Sales] END) AS [Before Sales],
    SUM(CASE WHEN week_number BETWEEN 25 and 37 THEN [Total Sales] END) AS [After Sales]
    FROM tsales12
)

SELECT [Before Sales], [After Sales], [After Sales] - [Before Sales] AS [Sales Time Diff], ROUND(100*([After Sales] - [Before Sales])/ [Before Sales],2) AS [Growth/Decline in Sales]
FROM before_after_sales12

--Here we can see that there was a decline of sales twelve weeks after week 25 which was at a 2.14% decline in the year 2020

